      <div className="status">{props.status}</div>
      <style jsx>{`
        #wrapper {
          display: flex;
          flex-direction: column;
          border: 1px solid #ccc;
          border-radius: 4px;
          padding: 5px;
        }
      `}</style>
    </div>
  );
}

export default AdAccount;
